//数据初始化在reducer
const initState = [{
    id:1,
    title: 'Apple',
    amount: 10,
    price: 888.66
},{
    id:2,
    title: 'Orange'
}]


export default (state = initState, action) => {
    switch(action.type){
        default:
            return state
    }
}
